import React, { useState } from 'react';
import styled from '@emotion/styled';
import { motion } from 'framer-motion';
import { FaGithub, FaExternalLinkAlt } from 'react-icons/fa';

// Import project images
import ProjectImage1 from '../assets/images/projects/project1.jpg';
import ProjectImage2 from '../assets/images/projects/project2.jpg';
import ProjectImage3 from '../assets/images/projects/project3.jpg';
import ProjectImage4 from '../assets/images/projects/project4.jpg';

const ProjectsContainer = styled(motion.div)`
  display: flex;
  flex-direction: column;
  align-items: center;
  min-height: 100vh;
  padding: ${props => props.theme.spacing.xl} ${props => props.theme.spacing.lg};
  background-color: transparent;
  margin-top: 80px;

  @media (max-width: 768px) {
    margin-top: 60px;
    padding: ${props => props.theme.spacing.lg} ${props => props.theme.spacing.md};
  }
`;

const SectionTitle = styled(motion.h1)`
  font-size: ${props => props.theme.typography.h1};
  color: ${props => props.theme.colors.primary};
  margin-bottom: ${props => props.theme.spacing.xl};
  text-align: center;
`;

const ProjectGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
  gap: ${props => props.theme.spacing.lg};
  width: 100%;
  max-width: 1200px;
`;

const ProjectCard = styled(motion.div)`
  background-color: ${props => 
    props.theme.mode === 'light' 
      ? 'rgba(255, 255, 255, 0.8)' 
      : 'rgba(26, 32, 44, 0.7)'
  };
  border-radius: ${props => props.theme.borderRadius.lg};
  padding: ${props => props.theme.spacing.lg};
  box-shadow: ${props => props.theme.shadows.light};
  backdrop-filter: blur(10px);
  border: 1px solid ${props => 
    props.theme.mode === 'light' 
      ? 'rgba(0, 0, 0, 0.05)' 
      : 'rgba(255, 255, 255, 0.1)'
  };
  transition: transform 0.3s ease, box-shadow 0.3s ease;

  &:hover {
    transform: translateY(-10px);
    box-shadow: ${props => props.theme.shadows.medium};
  }
`;

const ProjectImage = styled.img`
  width: 100%;
  height: 250px;
  object-fit: cover;
  border-radius: ${props => props.theme.borderRadius.md};
  margin-bottom: ${props => props.theme.spacing.md};
  transition: transform 0.3s ease;

  ${ProjectCard}:hover & {
    transform: scale(1.05);
  }
`;

const ProjectContent = styled.div`
  padding: 1.5rem;
`;

const ProjectTitle = styled.h2`
  font-size: ${props => props.theme.typography.h3};
  color: ${props => props.theme.colors.text};
  margin-bottom: ${props => props.theme.spacing.sm};
`;

const ProjectDescription = styled.p`
  color: ${props => props.theme.colors.textSecondary};
  margin-bottom: ${props => props.theme.spacing.md};
  font-size: 0.9rem;
`;

const TechStack = styled.div`
  display: flex;
  flex-wrap: wrap;
  gap: ${props => props.theme.spacing.xs};
  margin-bottom: ${props => props.theme.spacing.md};
`;

const TechTag = styled.span`
  background-color: ${props => props.theme.colors.primary}20;
  color: ${props => props.theme.colors.primary};
  padding: ${props => props.theme.spacing.xs} ${props => props.theme.spacing.sm};
  border-radius: ${props => props.theme.borderRadius.sm};
  font-size: 0.8rem;
`;

const ProjectLinks = styled.div`
  display: flex;
  justify-content: space-between;
`;

const ProjectLink = styled.a`
  display: flex;
  align-items: center;
  gap: ${props => props.theme.spacing.xs};
  color: ${props => props.theme.colors.text};
  text-decoration: none;
  transition: color 0.3s ease;

  &:hover {
    color: ${props => props.theme.colors.primary};
  }

  svg {
    margin-right: 0.5rem;
  }
`;

const projects = [
  {
    id: 1,
    title: 'AI-Powered Task Manager',
    description: 'A full-stack task management application with AI-driven productivity insights and smart scheduling.',
    image: ProjectImage1,
    technologies: ['React', 'Node.js', 'MongoDB'],
    githubLink: 'https://github.com/anusah/task-manager',
    liveLink: 'https://task-manager.vercel.app'
  },
  {
    id: 2,
    title: 'E-commerce Microservices Platform',
    description: 'Scalable e-commerce platform built with microservices architecture, featuring real-time inventory tracking.',
    image: ProjectImage2,
    technologies: ['Next.js', 'TypeScript', 'Stripe', 'MongoDB'],
    githubLink: 'https://github.com/anusah/ecommerce-microservices',
    liveLink: 'https://ecommerce-platform.herokuapp.com'
  },
  {
    id: 3,
    title: 'Machine Learning Visualization Dashboard',
    description: 'Interactive dashboard for visualizing machine learning model performance and dataset insights.',
    image: ProjectImage3,
    technologies: ['React', 'D3.js', 'TensorFlow'],
    githubLink: 'https://github.com/anusah/ml-dashboard',
    liveLink: 'https://ml-insights-dashboard.netlify.app'
  },
  {
    id: 4,
    title: 'Real-Time Collaborative Code Editor',
    description: 'Web-based collaborative code editor with syntax highlighting and real-time collaboration features.',
    image: ProjectImage4,
    technologies: ['React', 'Socket.io', 'MongoDB'],
    githubLink: 'https://github.com/anusah/collaborative-editor',
    liveLink: 'https://collaborative-code-editor.vercel.app'
  }
];

const Projects = () => {
  const [projectsState] = useState(projects);

  return (
    <ProjectsContainer
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      transition={{ duration: 0.5 }}
    >
      <SectionTitle
        initial={{ y: -50, opacity: 0 }}
        animate={{ y: 0, opacity: 1 }}
        transition={{ duration: 0.5 }}
      >
        My Projects
      </SectionTitle>
      <ProjectGrid>
        {projectsState.map((project, index) => (
          <ProjectCard
            key={project.id}
            initial={{ y: 50, opacity: 0 }}
            animate={{ y: 0, opacity: 1 }}
            transition={{ delay: index * 0.2, duration: 0.5 }}
          >
            <ProjectImage src={project.image} alt={project.title} />
            <ProjectContent>
              <ProjectTitle>{project.title}</ProjectTitle>
              <ProjectDescription>{project.description}</ProjectDescription>
              <TechStack>
                {project.technologies.map(tech => (
                  <TechTag key={tech}>{tech}</TechTag>
                ))}
              </TechStack>
              <ProjectLinks>
                <ProjectLink href={project.githubLink} target="_blank" rel="noopener noreferrer">
                  <FaGithub /> GitHub
                </ProjectLink>
                <ProjectLink href={project.liveLink} target="_blank" rel="noopener noreferrer">
                  <FaExternalLinkAlt /> Live Demo
                </ProjectLink>
              </ProjectLinks>
            </ProjectContent>
          </ProjectCard>
        ))}
      </ProjectGrid>
    </ProjectsContainer>
  );
};

export default Projects;
